import './style.scss';
import Modal from 'antd/lib/modal/Modal';
import {useState} from 'react';
import moment from 'moment';
import '../../styles/ant-picker.scss'
const calendar = ()=>{

    //Data from database 
    const Booked = ['08:00-10:00','10:00-11:00'];
    const Horraire = ['09:30','17:00'];
    const StartHour = moment(Horraire[0],"HH:mm");
    const endtHour = moment(Horraire[1],"HH:mm");
    const Result = [];
    const string  = StartHour.format('HH:mm')+"-"+StartHour.add(1,'hours').format('HH:mm') ;
    console.log(string);
    // States -------------------
    const [visible,setvisible] = useState(false);
    const [title , setTitle] = useState();

    // -----------------------
    const Days = ['Lundi','Mardi','Mercredi','Jeudi','Vendredi','Samedi','Dimanche'];
    const Hours = ['08:00-10:00','10:00-11:00','11:00-12:00','12:00-13:00','13:00-14:00','14:00-15:00','15:00-16:00'];
    return(
        <table id="customers">
            <Modal title={`${title} | Entrez votre message`} visible={visible} width="50vw" onCancel={()=>setvisible(false)} footer={null}>Hello</Modal>
            <thead>
                <tr>
                    <th></th>
                    {Days.map(day =>(<th key={day+Date.now()} >{day}</th>))}
                </tr>
            </thead>
            <tbody>
                {Hours.map(hour => (
                    <tr key={hour+Date.now()}> 
                        <th>{hour}</th>
                        {Days.map(day =>(
                        <td key={day+hour} onClick={()=>{setTitle(hour+day); setvisible(true)}}>
                        
                        </td>))}
                    </tr>
                ))}
            </tbody>
            
        </table>
    )
}
export default calendar ;
